export function getIconForLanguageExtension(language: string) {
  switch (language) {
    case "json":
      return <Icons.json />
    case "css":
      return <Icons.css className="fill-foreground" />
    case "postcss":
      return <Icons.postcss className="fill-foreground" />
    case "js":
    case "jsx":
    case "ts":
    case "tsx":
      return <Icons.typescript className="fill-foreground" />
    case "typescript":
      return <Icons.typescript className="fill-foreground" />
    case "reactjs":
      return <Icons.reactjs className="fill-foreground" />
    case "nextjs":
      return <Icons.nextjs className="fill-foreground" />
    case "tailwindcss":
      return <Icons.tailwindcss className="fill-foreground" />
    case "shadcn":
      return <Icons.shadcn className="fill-foreground" />
    default:
      return <FileIcon />
  }
}
